import React, { Component } from 'react';

class RegistroPonto extends React.Component {

    getInitialState () {
        teste: 1
    }

    render() {
      return (
        <div className="shopping-list">
          <h1>Shopping List for</h1>
          <ul>
            <li>Instagram</li>
            <li>WhatsApp</li>
            <li>Oculus</li>
          </ul>
        </div>
      );
    }
}

export default RegistroPonto;
